  [],\n\t\"revision_timestamp\": \"2016-07-15T04:23:36.750726\",\n\t\"name\": \"asthma-medication-ratio-predicts-emergency-depart-590c4\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>According to findings reported in Asthma
  Medication Ratio Predicts Emergency Department Visits and Hospitalizations in Children
  with Asthma, published in Volume 3, Issue 4 of the Medicare and Medicaid Research
  Review, the controller-to-total asthma medication ratio, calculated using pharmacy
  claims data, can predict both emergency department visits and hospitalizations in
  children with asthma. Patients with a ratio of less than 0.5 (meaning fewer controller
  and more rescue medication claims) were 1.5-2.0 times more likely to have a subsequent
  emergent healthcare visit than children with higher ratios. Providers and payers
  may consider tracking the asthma medication ratio and using it to signal pediatric
  patients at high risk for emergent health care visits. This will allow targeted
  interventions to improve controller medication use in these highest risk patients.
  Ultimately, increasing controller medication use in these patients would lead to
  improved ratios and fewer emergent healthcare visits.</p>n\",\n\t\"license_title\":
